function I = fcnK1R(S, T, u, alpha, F, tol)
t1 = sqrt(-u);t3 = 0.1e1 ./ u .* t1;t4 = S .* u;t5 = -t4 + u;t6 = 0.1e1 ./ t5;t7 = F - t1;t8 = 0.1e1 ./ t7;t10 = t7 .^ 2;t12 = S .* t1;t13 = t7 .* t12;t16 = sqrt(t10 .* S + 0.2e1 .* t13 - t4 + u);t17 = 0.1e1 ./ t16;t21 = t5 .^ 2;t22 = 0.1e1 ./ t21;t23 = t22 .* S;t26 = S .^ 2;t27 = t26 .* t3;t32 = sqrt(t5);t35 = 0.1e1 ./ t32 ./ t21 .* S;t39 = log(0.2e1 .* t8 .* (t16 .* t32 + t13 - t4 + u));t42 = u .^ 2;t45 = t6 ./ t42 .* t1;t50 = F + t1;t51 = 0.1e1 ./ t50;t53 = t50 .^ 2;t55 = t50 .* t12;t58 = sqrt(t53 .* S - t4 - 0.2e1 .* t55 + u);t59 = 0.1e1 ./ t58;t72 = log(0.2e1 .* t51 .* (t58 .* t32 - t4 - t55 + u));t79 = t17 .* t8 .* t6 .* t3 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t17 .* t23 + 0.3e1 ./ 0.4e1 .* F .* t17 .* t22 .* t27 + 0.3e1 ./ 0.4e1 .* t39 .* t35 + F .* S .* t17 .* t45 ./ 0.2e1 - t59 .* t51 .* t6 .* t3 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t59 .* t23 - 0.3e1 ./ 0.4e1 .* F .* t59 .* t22 .* t27 + 0.3e1 ./ 0.4e1 .* t72 .* t35 - F .* S .* t59 .* t45 ./ 0.2e1;
I = t79(:,:,2) - t79(:,:,1);

end
